ast modified, in the site\'s timezone.'=>'Дата последнего изменения изображения в часовом поясе сайта.','The date the order was completed, as GMT.'=>'Дата завершения заказа (в формате GMT).','The date the order was completed, in the site\'s timezone.'=>'Дата завершения заказа в часовом поясе сайта.','The date the order was created, as GMT.'=>'Дата создания заказа (в формате GMT).','The date the order was last modified, as GMT.'=>'Дата последнего изменения заказа (в формате GMT).','The date the order was last modified, in the site\'s timezone.'=>'Дата последнего изменения заказа в часовом поясе сайта.','The date the order was paid, as GMT.'=>'Дата оплаты заказа (по часовому поясу GMT).','The date the order was paid, in the site\'s timezone.'=>'Дата оплаты заказа в часовом поясе сайта.','The date the product was created, as GMT.'=>'Дата создания товара (в формате GMT).','The date the product was created, in the site\'s timezone.'=>'Дата создания товара в часовом поясе сайта.','The date the product was last modified, as GMT.'=>'Дата последнего изменения товара (в формате GMT).','The date the product was last modified, in the site\'s timezone.'=>'Дата последнего изменения товара в часовом поясе сайта.','The resource cannot be deleted.'=>'Этот ресурс не может быть удалён.','To manipulate product variations you should use the /products/&lt;product_id&gt;/variations/&lt;id&gt; endpoint.'=>'Для управления вариациями товаров нужно использовать эндпойнт /products/&lt;product_id&gt;/variations/&lt;id&gt;.','Total discount amount for the order.'=>'Итоговая сумма скидки заказа.','Total discount tax amount for the order.'=>'Итоговая сумма скидки налога заказа.','Total shipping amount for the order.'=>'Итоговая стоимость доставки заказа.','Total shipping tax amount for the order.'=>'Итоговая сумма налога на доставку заказа.','True the prices included tax during checkout.'=>'Отображает включают ли цены налоги в момент оформления заказа.','Unable to restore stock for item %s.'=>'Не 